collections::hash::set::HashSet::<T, S>:.doc:
Visits the values representing the difference,
i.e., the values that are in `self` but not in `other`.

# Examples

```
use std::collections::HashSet;
let a = HashSet::from([1, 2, 3]);
let b = HashSet::from([4, 2, 3, 4]);

// Can be seen as `a - b`.
for x in a.difference(&b) {
    println!("{x}"); // Print 1
}

let diff: HashSet<_> = a.difference(&b).collect();
assert_eq!(diff, [1].iter().collect());

// Note that difference is not symmetric,
// and `b - a` means something else:
let diff: HashSet<_> = b.difference(&a).collect();
assert_eq!(diff, [4].iter().collect());
```

core::iter::Iterator::chain.doc:
Takes two iterators and creates a new iterator over both in sequence.

`chain()` will return a new iterator which will first iterate over
values from the first iterator and then over values from the second
iterator.

In other words, it links two iterators together, in a chain. ðŸ”—

[`once`] is commonly used to adapt a single value into a chain of
other kinds of iteration.

# Examples

Basic usage:

```
let s1 = "abc".chars();
let s2 = "def".chars();

let mut iter = s1.chain(s2);

assert_eq!(iter.next(), Some('a'));
assert_eq!(iter.next(), Some('b'));
assert_eq!(iter.next(), Some('c'));
assert_eq!(iter.next(), Some('d'));
assert_eq!(iter.next(), Some('e'));
assert_eq!(iter.next(), Some('f'));
assert_eq!(iter.next(), None);
```

Since the argument to `chain()` uses [`IntoIterator`], we can pass
anything that can be converted into an [`Iterator`], not just an
[`Iterator`] itself. For example, arrays (`[T]`) implement
[`IntoIterator`], and so can be passed to `chain()` directly:

```
let a1 = [1, 2, 3];
let a2 = [4, 5, 6];

let mut iter = a1.into_iter().chain(a2);

assert_eq!(iter.next(), Some(1));
assert_eq!(iter.next(), Some(2));
assert_eq!(iter.next(), Some(3));
assert_eq!(iter.next(), Some(4));
assert_eq!(iter.next(), Some(5));
assert_eq!(iter.next(), Some(6));
assert_eq!(iter.next(), None);
```

